import React from "react";

import Button from '@mui/material/Button';

export default function NavBar() {
  return (
    <nav>
        <div className="nav-wrapper">
        {/* //home button */}
            <div className="ColaCoLogo"> 
                <img 
                className="colacoLogo"
                src="https://ik.imagekit.io/0ef3zk1rums/ColaCo-ZoomedIn_XfFaP4Vq4?updatedAt=1640409185081" 
                alt="ColaCo logo" />
            </div>
            {/* inventory stuff */}
            <Button className="nav-btn" variant="text">DashBoard</Button> 
        </div>  
    </nav>
  );
}
